import React from "react";

function Nav() {
  return (
    <nav className="navbar navbar-expand-lg navbar-dark bg-primary">
      <a className="navbar-brand" href="/"
        style={{ textAlign: "center" }}
      >
        HouseWork
      </a>
    </nav>
  );
}

export default Nav;
